import { Button, Select, Form, Input } from 'antd';
import { Link, useParams } from 'react-router-dom';
import { useState, useEffect } from 'react';

function Logon( props ) {
    if (props) {
        return (
            <div>
                <Link to={`/logout`}>Logout</Link>
                <Link to={`/cart`}>Cart</Link>
            </div>
        );
    } else {
        return (
            <div>
                <Link to={`/login`}>Login</Link>
            </div>
        )
    }
}

function NavBar() {
    return (
        <div>
            <Link to={`/`}>Home</Link>
            <Link to={`/gender/man`}>Man</Link>
            <Link to={`/gender/woman`}>Woman</Link>
            <Link to={`/gender/kid`}>Kid</Link>
        </div>
    );
}

function SearchBar() {
    return (
        <Form style={{width: 200}}>
            <Input type="text" placeholder="Search shoe" />
            <Input type="submit" value="Search" />
        </Form>
    );
}

function image({ imageURL }) {
    return (

        <img src={imageURL} width="500px" height="500px" />
    )
}

export default function ShoeView() {
    return (
        <p>ajd</p>
    )
}
